import React from "react";
import { Link } from "react-router-dom";

const Note = () => {
  return (
    <div className="slender--container">
      <div className="slender--link">
        <h1>YOU FOUND A NOTE</h1>

        <Link to="/start" className="arrow">
          Go back
        </Link>
      </div>
    </div>
  );
};

export default Note;
